import React from "react";

const Select = ({
  currentSelectedPriority,
  hadleOnChangePriority,
  options,
}) => {
  return (
    <select
      className="form-control"
      value={currentSelectedPriority}
      onChange={hadleOnChangePriority}
    >
      {options.map((res) => {
        <option value={res}>{res?.name}</option>;
      })}
    </select>
  );
};
export default Select;
